US Secretary of Commerce Gina Raimondo and her delegation visited NYU Shanghai on Wednesday, August 30. Chancellor Tong, Vice Chancellor Lehman, and Provost Waley-Cohen gave 
@SecRaimondo
and 
@USAmbChina
 a tour of the New Bund Campus and Raimondo interacted with students.

US Secretary of State Antony Blinken 
@SecBlinken
 visited NYU Shanghai on April 25 as part of his trip to Beijing and Shanghai. He was greeted by the university's leadership and engaged in a meaningful discussion with students for over 30 minutes.
